import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Drawer from '@material-ui/core/Drawer';
import AppBar from '@material-ui/core/AppBar';
import CssBaseline from '@material-ui/core/CssBaseline';
import Toolbar from '@material-ui/core/Toolbar';
import List from '@material-ui/core/List';
import Typography from '@material-ui/core/Typography';
import Divider from '@material-ui/core/Divider';
import ListItem from '@material-ui/core/ListItem';
import ListItemIcon from '@material-ui/core/ListItemIcon';
import ListItemText from '@material-ui/core/ListItemText';
import InboxIcon from '@material-ui/icons/MoveToInbox';
import MailIcon from '@material-ui/icons/Mail';

const drawerWidth = 240;

const useStyles = makeStyles((theme) => ({
  root: {
    display: 'flex',
  },
  appBar: {
    zIndex: theme.zIndex.drawer + 1,
  },
  drawer: {
    width: drawerWidth,
    flexShrink: 0,
  },
  drawerPaper: {
    width: drawerWidth,
  },
  drawerContainer: {
    overflow: 'auto',
  },
  content: {
    flexGrow: 1,
    padding: theme.spacing(3),
  },
}));

export function SideBar() {
  const classes = useStyles();
  return (
    <div className={classes.root}>
      <CssBaseline />
      <AppBar position="fixed" className={classes.appBar}>
        <Toolbar>
          <Typography variant="h6" noWrap>
            Clipped drawer
          </Typography>
        </Toolbar>
      </AppBar>
      <Drawer
        className={classes.drawer}
        variant="permanent"
        classes={{
          paper: classes.drawerPaper,
        }}
      >
        <Toolbar />
        <div className={classes.drawerContainer}>
        <List>
        <ListItem button key={1}>
          <ListItemIcon>
            <Avatar src={user ? user.photo : null}></Avatar>
          </ListItemIcon>
          <ListItemText primary={user.firstname + " " + user.lastname} />
        </ListItem>
        <Divider></Divider>
        <ListItem button key={2}>
          <ListItemIcon>
            <EmojiPeopleIcon style={{ color: 'blue' }}></EmojiPeopleIcon>
          </ListItemIcon>
          <ListItemText primary={"Bạn bè"} />
        </ListItem>
        <ListItem button key={3}>
          <ListItemIcon>
            <SupervisedUserCircleIcon color='primary'></SupervisedUserCircleIcon>
          </ListItemIcon>
          <ListItemText primary={"Nhóm"} />
        </ListItem>
        <ListItem button key={4}>
          <ListItemIcon>
            <FavoriteIcon style={{ color: 'red' }}></FavoriteIcon>
          </ListItemIcon>
          <ListItemText primary={"Yêu thích"} />
        </ListItem>
        <ListItem button key={5}>
          <ListItemIcon >
            <RestaurantOutlinedIcon style={{ color: 'green' }}></RestaurantOutlinedIcon>
          </ListItemIcon>
          <ListItemText primary={"Nhà hàng của tôi"} />
        </ListItem>
      </List>
        </div>
      </Drawer>
    </div>
  );
}
